import { Col, Card } from "antd";

const Note = (params) => {
  // console.log(params);
  return (
    <Col span={8}>
      <Card title={params.note.name} bordered={true} style={{marginBottom: "5px"}}>
        {params.note.description}
      </Card>
    </Col>
  );
};

export default Note;
